Mazada () is a rural locality (a selo) and the administrative center of Mazadinsky Selsoviet, Tlyaratinsky District, Republic of Dagestan, Russia. Population:
Geography
Mazada is located 25&nbsp;km north of Tlyarata (the district's administrative centre) by road. Rosta is the nearest rural locality.
